import React from 'react';
import { Link } from 'react-router-dom';


const Header = () => {
    let status =  localStorage.setItem("isLogin", true);

    return (
        <div className="ui secondary pointing menu">
            <Link to="/" className="item">Demo App </Link>
        <div className="ui secondary pointing menu">
            <Link to ="/PostList" className="item">PostList</Link>
        <div className='right menu'>
            {(status === true ? <Link to='/CreatePost' className='item'> Create new Post</Link> :
                <Link to='/login' className='item'> Create new Post</Link>
            )}
        <div className="ui secondary pointing menu">
            <Link to ="/Login" className="ui button primary"> Login</Link>
        <div className="ui secondary pointing menu">
             <Link to ="/SignUp" className="ui button primary">
                              SignUp
                              </Link>
                     </div>
                </div>
                </div>
            </div>
        </div>

    );
};
export default Header;
